import PaypalTwo from './Paypal/PaypalTwo';
import styled from 'styled-components';

const DIV = styled.div`
    margin: 0 auto;
    border: none;
    box-shadow: 0px 0px 2px 0px;
    margin-top: 80px; 
    padding: 20px;
    max-width: 70%;
    border-radius: 20px;

    p{
        font-size: 30px;
    }
`
const MassComm = () => {
    return (  
        <DIV>
            <p>Mass Communication</p>
            <PaypalTwo />
        </DIV>
    );
}
 
export default MassComm;
